  \"Collaborative Outbound Taxi Metering for Environmental Benefits Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:36:07.686025\",\n\t\"name\": \"collaborative-outbound-taxi-metering-for-environmental-benefits-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This proposal addresses the concept of Collaborative
  Outbound Taxi Metering (COTM), which provides environmental benefits without sacrificing
  throughput.  In current operations, departure flights must block out of their parking
  gates to claim their first-come, first-served departure slot.  When departure demand
  exceeds capacity, flights experience delay in departure queues near the runway.
  \ The need for flights to make incremental steps in the queue significantly increases
  the engine emissions produced because of the number of times aircraft must apply
  'break-away' power, only to stop again after moving just a short distance.  Under
  the COTM concept, metering techniques assign and maintain departure slots for all
  departure flights even if aircraft remain at their parking gates.  Mosaic ATM has
  conducted initial analysis using historical operational data demonstrating the potential
  environmental benefits even in the presence of arrival flights requiring parking
  gates.  This concept has already been applied and shown significant benefits during
  over-night operations of air cargo carriers.  Implementing the concept across the
  entire NAS has not been possible due to the requirement to coordinate departure
  metering amongst multiple airport users.  We propose to further demonstrate the
  feasibility and benefits of the COTM concept at large hub airports.  \",\n\t\"license_title\":
